  NavbarBrand, 
  NavbarToggler,
  NavItem,
  NavLink,
  Collapse
} from 'reactstrap';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isOpen: false
    };
    this.toggleNavbar = this.toggleNavbar.bind(this);
  }

  toggleNavbar() {
    this.setState({isOpen: !this.state.isOpen});
